import axios from 'axios';

export const getEvent = async () => {
    const response = await axios.get(`http://54.180.86.22:8080/api/events`);
    const data = response.data;
  
    // category가 null인 데이터를 걸러냅니다.
    const filteredData = data.filter(event => event.start !== null);
  
    return filteredData;
  }

export const postEvent = async (eventData) => {
    const requestOptions = {
      method: 'post',
      url: `http://54.180.86.22:8080/api/events`,
      data: eventData,
      headers: {
        'Content-Type': 'application/json',
      },
    };
  
    const response = await axios(requestOptions);
    return response.data;
  };
